export default (function(a,b,c,d,e,f,g,h,i,j){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},ywqoOMeByE:{data:{id:577,attributes:{imdbId:"tt0062794",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMWUxOTM0YjEtNjM1Yi00ZmVlLTllNDYtMDdhYmNkYmE5YzgzXkEyXkFqcGdeQXVyMTMxMTY0OTQ@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"7.0\u002F10"},{Source:"Rotten Tomatoes",Value:"60%"},{Source:"Metacritic",Value:"50\u002F100"}],item_lang:{data:{id:1240,attributes:{title:"Charly",plot:"Charly is an adult male with a cognitive disability, struggling to survive in the modern world. His frequent attempts at learning, reading and writing prove difficult, and he is the subject of cruel pranks at the bakery where he does minor janitorial work. His teacher, Mrs. Kinnian, enrolls Charly in a clinical study where he is observed by a surgeon and a psychologist who have Charly \"race\" a mouse named Algernon, solving mazes. Algernon is usually the winner, thanks to an experiment involving brain proteins that greatly raised his intelligence. The experiment proceeds with surgery on Charly, who at first does not seem affected. However, he quickly becomes more logically advanced, soon becoming a pure genius. Emotional and intra-personal consequences are involved as Charly and his teacher become increasingly attached to one another. But when Charly gradually suspects the consequences of the experiment, he struggles with whether or not the procedure was a good idea.",slug:"charly"}}},books:{data:[{id:4115,attributes:{title:"Flowers For Algernon",description:"The classic novel about a daring experiment in human intelligence Charlie Gordon, IQ 68, is a floor sweeper and the gentle butt of everyone's jokes - until an experiment in the enhancement of human intelligence turns him into a genius. But then Algernon, the mouse whose triumphal experimental transformation preceded his, fades and dies, and Charlie has to face the possibility that his salvation was only temporary.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=8Pr_kLFxciYC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:true,published:"2012-11-15",publisher:"Hachette UK",subtitle:"A Modern Literary Classic"}},{id:4116,attributes:{title:c,description:"'A masterpiece of poignant brilliance . . . heartbreaking' Guardian Charlie Gordon, a floor sweeper born with an unusually low IQ, has been chosen as the perfect subject for an experimental surgery that doctors hope will increase his intelligence - a procedure that has been highly successful when tested on a lab mouse named Algernon. All Charlie wants is to be smart and have friends, but the treatement turns him into a genius. Then Algernon begins to fade. What will become of Charlie?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=VbOtAQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2017-07-13",publisher:"Weidenfeld & Nicolson",subtitle:e}},{id:4117,attributes:{title:c,description:"Traditional Chinese edition of Flowers for Algernon, the Daniel Keyes classic. Charlie, a simple young man who was born with a very low IQ, became a perfect subject for an experimental surgery to improve his intelligence, an experiment that was successful for Algernon, a mouse A novella that won the Hugo Award in 1960 and the Nebula in 1966 and inspired the film Charly for which Cliff Robertson received an Oscar for Best Actor in 1969. In Chinese. Distributed by Tsai Fong Books, Inc.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=JLunPwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"1989-01-01",publisher:"Heinemann Educational Publishers",subtitle:e}},{id:4118,attributes:{title:c,description:"The compelling story of Charlie Gordon, willing victim of a strange experiment - a moron, a genius, a man in search of himself. Poignant, funny, tragic, but with a hope for the indomitable spirit of man, this unusual play tells a story you will long remember. It also offers a magnificent role.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=F1wgqlNi8AMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[h,a],firstBook:d,published:i,publisher:j,subtitle:"A Full-length Play"}},{id:4119,attributes:{title:c,description:e,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=gK98gXR8onwC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[h,a],firstBook:d,published:i,publisher:j,subtitle:"A One-act Play"}}]}}},meta:{}}},prerenderedAt:1682568404887}}("Daniel Keyes","movie","Flowers for Algernon",null,"","series",1,"David Rogers","1969-01-01","Dramatic Publishing"))